                Кто же не знает что такое русская банька? Да все знают её. Она очень любима и популярна во всем мире. Баня на Р");
            WriteLiteral(@"уси была ежедневным атрибутом. Первые бани первоначально были сделаны из камня, но впоследствии заменились на такой строительный материал как, дерево, потому что они изначально строились легче, чем каменные и были более востребованы среди народа. Баню на древней Руси использовали не только для гигиены, а также она приравнивалась к священным местам. Традиционно считалось, что человек, в каком бы возрасте он ни был, помывшись в бане, приобретал природную силу не только физическую, но и моральную. Отсюда и пошло языковое выражение «Помылся - будто заново родился».

